約５回のストロークで最高位まで上昇!!
<Br>ダブルピストン/強力シリンダーにより、アルミジャッキでは少ない２トン対応モデル!!<Br>
<Br>
★ストローク時に楽々のハンドル長さ1440ミリとロングタイプ<Br>
★受け皿はゴムラバー装備<Br>
傷防止、すべり止め防止の、ゴム受けパット標準装備<Br>
★デュアルピストン仕様　(ダブルピストン/ダブルプランジャー)<Br>
デュアルピストンは空荷状態と、荷重がかかった状態で、ストローク量が自動調整される機構です。<Br>
・空荷(軽い場合)では、約５回のストロークで最高位まで上昇<Br>
・実際に荷重がかかった場合は、、ストローク量(ストローク数)が変わります。<Br>
★リリーフ機構(ジャッキにやさしいオーバーロード弁採用)<Br>
受け皿部の最低位は、90ミリと車高の低い車にも対応!!<Br>
★サイズ<Br>
最低位：約90ミリ　/　最高位：約495ミリ<Br>
寸法：　約/長さ673ミリ×幅330ミリ×高さ受け皿部90ミリ、ボディ157ミリ<Br>
重量：　約21.5キロ<Br>
※対応荷重：　2トン(ANSI規格)/1814kg<Br>
 ※米トン表記は、ポンド換算となり、1トン＝2000ポンド＝907.18474キログラムとなります。<Br>
※取扱説明書付属（一部日本語表記です）<Br>
★平行輸入品<Br>
★販売元：　アメリカ、Power Station社　(NOSブランド)<Br>
★製造国：　中国<Br>
<Br>
<Br>
※重要※<Br>
トラブル防止の為、必ず、商品到着後はすぐに、動作の確認等をお願い致します。<Br>
万が一の初期不良は、販売店対応としまして、到着後、1週間までとさせて頂きます。<Br>
※輸入商品となりますので、下記、保証対応を予めご了承頂いた上でのご注文でお願い致します。<Br>
<Br>
■保証規定<Br>
 輸入商品となりますので、お届け後1週間の初期不良のみ当店にて対応致します。<Br>
 到着後は必ず、すぐに商品内容を確認、ジャッキアップ作業を行い、動作確認を行って下さい。<Br>
1週間を越えた商品に関しましては、対応できませんので、予めご了承下さい。<Br>
 商品販売のみとなりますので、修理受付、部品の手配等は行えません。<Br>
 予めご了承頂きました上でのご注文でお願い致します。<Br> 

●ジャッキ使用に関して<Br>
 ジャッキ使用/ジャッキアップ作業は、安易に考えがちですが、1t以上ある車を持ち上げる→車の下にもぐるといった非常に危険な作業となります。<Br>
 使用方法も含め、最低限の基本作業をご理解頂いている方のご購入でお願い致します。<Br>
<Br>
 ～基本使用方法～<Br>
・本体へ確実にハンドルを挿しこんで、ボルトで抜けないよう固定して下さい。<Br>
・右回転させ締め込む事で上げ方向→ハンドルを上下させて上昇させて下さい。<Br>
・左回転させ緩める事で下げ方向→急激に回すと急激に下がりますのでゆっくりと回して下さい。<Br>
・必ず平ら場所で、コンクリートなど固い地面で作業を行って下さい。<Br>
・お車ごとの確実なジャッキアップポイントにてジャッキアップを行って下さい。<Br>
・必ずタイヤ止めなどを使用して車両が動き出さないよう対策して下さい。<Br>
・ジャッキアップ後は必ずウマなどをかけて作業を行って下さい。<Br>
※ジャッキは車両を持ち上げる為の工具であり、ジャッキアップしたまま車の下に潜るのは絶対にNGです!!<Br>

・ジャッキ使用、ジャッキアップ作業が始めての方、不慣れな方は、必ず経験者の指導のもと作業を行って下さい。<Br>

※輸入品の為、元箱に多少のツブレ、汚れ等がある場合がございます。<Br>
※輸入品の為、本体に多少の小キズ、すり傷等がある場合がございます。<Br>
※重量物商品となりますので、元箱に直接伝票を貼っての出荷となります。<Br><style type="text/css">
